module.exports = {
  root: true,
  // This tells ESLint to load the config from the package `eslint-config-custom`
  extends: ["custom"],
  settings: {
    next: {
      rootDir: ["apps/*/"],
    },
  },
};

[workspace]
resolver = "2"
members = [ "apps/cli","apps/desktop/src-tauri", "crates/*"]

[workspace.dependencies]
anyhow = "1.0.86"
# This includes a currently-unreleased fix that ensures the audio stream is actually
# stopped and released on drop on macOS
cpal = { git = "https://github.com/RustAudio/cpal", rev = "f43d36e55494993bbbde3299af0c53e5cdf4d4cf" }
ffmpeg = { package = "ffmpeg-next", git = "https://github.com/CapSoftware/rust-ffmpeg", rev = "91b29d09a8c7cb4f5659c38f1f0924b980a30cba" }
ffmpeg-sys-next = "7.1.0"
tokio = { version = "1.39.3", features = [
	"macros",
	"process",
	"fs",
	"sync",
	"rt",
	"rt-multi-thread",
	"time",
] }
tauri = { version = "2.1.1" }
specta = { version = "=2.0.0-rc.20" }
scap = { git = "https://github.com/CapSoftware/scap", rev = "58d4410bf52f" }
nokhwa = { git = "https://github.com/CapSoftware/nokhwa", rev = "0d3d1f30a78b", features = [
	"input-native",
	"serialize",
] }
nokhwa-bindings-macos = { git = "https://github.com/CapSoftware/nokhwa", rev = "0d3d1f30a78b" }
wgpu = "22.1.0"
flume = "0.11.0"
thiserror = "1.0"
sentry = { version = "0.34.0", features = [
	"anyhow",
	"backtrace",
	"debug-images",
] }

windows = "0.58.0"
windows-sys = "0.59.0"
windows-capture = "=1.3.6"

{
  "type": "module",
  "scripts": {
    "build": "dotenv -e .env -- turbo run build",
    "dev": "(cd apps/web && docker compose up -d && cd ../..) && dotenv -e .env -- pnpm --dir packages/database db:generate && dotenv -e .env -- pnpm --dir packages/database db:push && dotenv -e .env -- turbo run dev --filter=!@cap/storybook --no-cache --concurrency 12",
    "dev:manual": "dotenv -e .env -- turbo run dev --filter=!@cap/storybook --no-cache --concurrency 1",
    "lint": "turbo run lint",
    "format": "prettier --write \"**/*.{ts,tsx,md}\"",
    "db:push": "dotenv -e .env -- pnpm --dir packages/database db:push",
    "db:generate": "dotenv -e .env -- pnpm --dir packages/database db:generate",
    "db:studio": "dotenv -e .env -- pnpm --dir packages/database db:studio",
    "tauri:build": "dotenv -e .env -- pnpm --dir apps/desktop tauri build --verbose",
    "typecheck": "pnpm tsc -b"
  },
  "devDependencies": {
    "@turbo/gen": "^1.9.7",
    "dotenv-cli": "latest",
    "eslint": "^7.32.0",
    "extract-zip": "^2.0.1",
    "prettier": "^2.5.1",
    "turbo": "^1.10.16"
  },
  "packageManager": "pnpm@9.8.0",
  "name": "cap",
  "engines": {
    "node": "20"
  },
  "pnpm": {
    "patchedDependencies": {
      "@kobalte/core@0.13.7": "patches/@kobalte__core@0.13.7.patch"
    }
  }
}
